import React from 'react';
import { Button } from '@geist-ui/react';
import { ProfileContainer, ProfileHeader } from '../Profile';
import { TextMedium16, TextMedium22 } from '../../utils';

function Profile() {
  return (
    <ProfileContainer>
      <ProfileHeader>
        <div className='profile-header'>
          <div className='profile-header__left'></div>

          <div className='profile-header__right'>
            <Button primary auto>
              {' '}
              Edit Profile
            </Button>
          </div>
        </div>
      </ProfileHeader>
    </ProfileContainer>
  );
}

export default Profile;
